import React from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { Button, Dialog, DialogActions, DialogContent, DialogTitle, TextField, Typography, Box } from '@mui/material';

function HomePage() {
  const handleLoginSuccess = (credentialResponse) => {
    console.log('Přihlášení úspěšné! Credential Response:', credentialResponse);
    // Zde můžete zpracovat přihlášení, např. poslat token na server pro ověření
  };

  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Vítejte na GymNest
      </Typography>
      <Button variant="outlined" onClick={handleClickOpen}>
        Přihlásit se
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Přihlášení</DialogTitle>
          <GoogleLogin 
            onSuccess={handleLoginSuccess} 
            onError={() => console.log('Přihlášení selhalo')}
          />
        <DialogActions>
          <Button onClick={handleClose}>Zrušit</Button>
        </DialogActions>
      </Dialog>
      <Typography variant="h6" sx={{ mt: 4 }}>
        Veřejné rozvrhy
      </Typography>
      {/* Zde by se zobrazil seznam veřejných rozvrhů */}
      <Typography variant="h6" sx={{ mt: 4 }}>
        Soukromé rozvrhy
      </Typography>
      {/* Po přihlášení zde budou zobrazeny soukromé rozvrhy */}
    </Box>
  );
}

export default HomePage;
